import React from 'react';
import Header from "../../UI/Header/Header";

const Profile = () => {
    return (
        <div className={'profile__container'}>
            <Header/>
            <div className={'profile__content'}>
                <div className={'profile__theme'}></div>

                <div className={'profile__'}>

                </div>
            </div>
        </div>
    );
};

export default Profile;
